import React, { Component } from "react";
import GameLayout from "../../components/GameLayout";
import Head from "next/head";
import {
    BrowserView,
    MobileView,
  } from "react-device-detect";
class Theresume extends Component {

    render() {
        return (
            
            <GameLayout>
                <h1>The Resume Game</h1>
                <style jsx>{`
                        iframe 
                        {
                         display: block; 
                         margin: 0;
                         position: absolute;
                         top: 0;
                         left: 0;
                         width: 100%;
                         height: 100%;
                         border: none; 
                         overflow-y: auto; 
                         overflow-x: hidden;                         
                        }
                    `}</style>
                        <iframe frameborder="0" src="https://itch.io/embed-upload/1857824?color=333333" allow="">
                            <a href="https://msomsap.itch.io/the-resume-game">Play The  Resume Game on itch.io</a>
                        </iframe>
            </GameLayout>               
        )
    }
}

export default Theresume;
